import React, { useState } from "react";
import { Document, Page } from "react-pdf";
import { pdfjs } from "react-pdf";
import pdfjsWorker from "pdfjs-dist/build/pdf.worker.min.js"; // or the appropriate file

pdfjs.GlobalWorkerOptions.workerSrc = pdfjsWorker;

export default function PDFViewer() {
  const [file, setFile] = useState("../../assets/files/i-9.pdf");

  const onFileChange = (event) => {
    setFile(event.target.files[0]);
  };

  const onFileUpload = () => {
    const formData = new FormData();
    formData.append("pdf_file", file);
    formData.append("full_name", "John Doe");
    formData.append("date_of_birth", "1990-01-01");
    formData.append("submitted_year", new Date().getFullYear());

    fetch("http://127.0.0.1:8000/upload_pdf/", {
      method: "POST",
      body: formData,
    })
      .then((response) => response.json())
      .then((data) => console.log(data));
  };

  return (
    <div>
      <input type="file" onChange={onFileChange} />
      <button onClick={onFileUpload}>Upload PDF</button>
      <Document file={file}>
        <Page pageNumber={1} />
      </Document>
    </div>
  );
}
